import React from 'react';
import { FaFacebook } from "@react-icons/all-files";
const Navbar = () => {
    return (
        <nav className="nav_main">
          <div className="logo">
            <h1>Faizan</h1>
          </div>
          <div className="nav_items">
           <a href="">Home</a>
           <a href="">About</a>
           <a href="">Contact</a>
           <a href="">Address</a>
           <a href="">Blog</a>
          </div>
          <div className="socal_icons">
<FaFacebook />
          </div>
        </nav>
    )
}
export default Navbar;
